import React, {useState, useEffect} from 'react';
import axios from 'axios';
import DisplayUser from './DisplayUser';
import './App.css';
function FetchUser() {
    const [posts, setPosts] = useState([])
    const fetchUrl = 'https://api.spaceXdata.com/v3/launches?limit=100';
    useEffect(() => {
        axios.get(fetchUrl)
        .then(res => {
            console.log(res)
            setPosts(res.data)
        })
        .catch(err =>{
             console.log(err)
        })
    },[])


    
 
   return posts.map(item => {     
       <DisplayUser data={item} />
    })

    
}

export default FetchUser
